import React, { Component } from 'react'

class OneShowFollower extends Component {
    render() {
        return (
            <div style={{ display: "flex", padding: "10px" }}>
                {this.props.follower.profile_pic ? (
                  <Avatar src={this.props.follower.profile_pic} alt="Profile" />
                ) : (
                  <Avatar src="/images/user.svg" alt="Profile" />
                )}
                <Link to={"/profile"}>
                  <span className="ml-2 " style={{ fontWeight: "bold" }}>
                    {this.props.follower.username}
                  </span>
                </Link>
              </div>
        )
    }
}

export default OneShowFollower
